import React, { Fragment } from 'react';
import { Provider } from 'react-redux';
import store from './store';

import DataView from './components/DataView';

const App = () => {
	return (
		<Provider store={store}>
			<Fragment>
				<DataView />
			</Fragment>
		</Provider>
	);
};

export default App;
